    <div className="FoundCard">
      <div className="FoundImg">
        <div className="upload"></div>
      </div>
      <div className="FoundDetails"></div>
      <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 1440 320"><path fill="#5000ca" fill-opacity="1" d="M0,0L60,0C120,0,240,0,360,42.7C480,85,600,171,720,197.3C840,224,960,192,1080,160C1200,128,1320,96,1380,80L1440,64L1440,320L1380,320C1320,320,1200,320,1080,320C960,320,840,320,720,320C600,320,480,320,360,320C240,320,120,320,60,320L0,320Z"></path></svg>
    </div>
  )
}

export default FoundCard
